Приложение HENDERSON для iPhone помогает мужчинам создать стильный гардероб на любой
случай. Сегодня наши салоны располагаются более чем в 160 крупнейших торговых центрах,
расположенных в 63 городах России. В коллекции HENDERSON представлена мужская одежда,
обувь, аксессуары, парфюм и косметика. Мы также предлагаем Покупателям воспользоваться
услугой индивидуального пошива HENDERSON Su Misura, благодаря которой вы сможете
создать уникальное изделие по вашим меркам.
Приложение HENDERSON помогает:
- совершать покупки в интернет-магазине с доставкой или самовывозом;
- узнавать о наличии изделий в салонах вашего города;
- получать информацию об акциях и скидках;
- находить ближайший к вам салон HENDERSON;

Объявления о продаже новых или подержанных (б/у) автомобилей с возможностью проверки авто по VIN-коду.

База объявлений Дрома от частных лиц и автосалонов насчитывает более 600 000 предложений со всей России. Машины на любой вкус и цвет, прямо с мобильного.


Купить авто на Дроме — легко!


– Нужный вам автомобиль легко отыскать с помощью фильтров.
Укажите интересующие параметры, например, модель, год выпуска и объем двигателя – приложение само подберет подходящие варианты.
– Подписывайтесь на объявления по интересным для вас параметрам
– Читайте отзывы других автовладельцев и делитесь своим опытом
– С помощью «полного отчета об авто» по VIN (вин) коду узнайте о его судьбе (ГИБДД, ПДД, Штрафы, аресты, ДТП, ГАИ)



Продать машину — ещё проще!

Размещайте объявления о продаже вашего авто прямо с телефона. Рассказывайте о характеристиках вашего авто или мото.
Дополняйте описание фотографиями.

Также, благодаря приложению, вы сможете:

– создавать подписки на объявления по интересующим параметрам автомобиля;
– получать моментальные уведомления о новых объявлениях;
– добавлять в избранное заинтересовавшие вас автомобили;
– проверять авто по вин-номеру в базе ГИБДД;
– добавлять заметки к объявлениям;
– управлять вашими объявлениями;
– переписываться с продавцами;
– получать уведомления об изменении цен на избранные авто и на другие события;
– сравнивать объявления между собой.


Если у вас возникли сложности с приложением, вы можете написать на почту mobile@drom.ru, и команда наших разработчиков обязательно поможет вам разобраться с проблемой.

O′STIN - магазин модной и удобной одежды по доступной цене, вдохновленный современными трендами больших городов для вашего идеального шоппинга!  

Читайте отзывы к понравившимся товарам, делитесь своими впечатлениями от покупки.   

А что бы шоппинг был по-настоящему приятным, у нас всегда приготовлены супер акции и скидки для выгодных покупок.

Зарегистрируйтесь в приложении и начните копить баллы, которые можно будет потратить на шоппинг и сделать покупки еще дешевле!  

Получите приветственные 300 бонусов онлайн сразу после регистрации!

Получайте персональные акции внутри личного кабинета, а также просматривайте раздел скидок внутри приложения.


  O’STIN это :

- Большой каталог одежды для всей семьи;

- Легкий поиск и фильтры для поиска одежды;

- Отзывы к товарам от покупателей;

- Персональные акции для выгодных покупок;

- Приветственный бонус при регистрации;

- Удобная доставка покупок;

- Разные варианты оплаты заказа;  

- Примерка заказа перед покупкой; 
 
- Легкий возврат заказа, если одежда не подошла;
 
Быстрая доставка, примерка перед покупкой, программа скидок и бонусов — O’STIN делает всё, чтобы шопинг был приятным и удобным.

Скачайте приложение и получайте удовольствие, ведь O’STIN – это одежда, которую вы любите!
